import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import { Link } from "react-router-dom/";
import logo from "../assets/img/logo.png";

const MyNavbar = () => {
  return (
    <Navbar expand="lg" className="bg-success sticky-top">
      <Container>
        <Navbar.Brand className="text-white" href="#home">
          <Link className="text-decoration-none text-white" to="/">
            <img
              src={logo} // Sostituisci "url_dell_immagine.jpg" con il percorso dell'immagine desiderata
              alt="Logo" // Specifica un testo alternativo per l'immagine
              style={{ height: "30px", marginRight: "10px" }} // Regola le dimensioni e lo stile dell'immagine
            />
          </Link>
          <Link className="text-decoration-none text-white" to="/">
            RainbowRadar
          </Link>
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <div className="d-flex gap-2 align-items-center">
              <Link className="text-decoration-none text-white" to="/">
                Home
              </Link>
              <Link className="text-decoration-none text-white" to="/profile">
                Profile
              </Link>
            </div>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default MyNavbar;
